function initialize() {
	var latlng = new google.maps.LatLng(41.035082, -74.144111);
	var settings = {
		zoom: 15,
		center: latlng,
		mapTypeControl: true,
		mapTypeControlOptions: {style: google.maps.MapTypeControlStyle.DROPDOWN_MENU},
		navigationControl: true,
		navigationControlOptions: {style: google.maps.NavigationControlStyle.SMALL},
		mapTypeId: google.maps.MapTypeId.ROADMAP};
			var map = new google.maps.Map(document.getElementById("map_canvas"), settings);
			var contentString = '<div id="content">'+
				'<div id="siteNotice">'+
				'</div>'+
				'<h3 id="firstHeading" class="firstHeading">Northern Highlands</h3>'+
				'<div id="bodyContent">'+
				'<p style="width:250px;">Highlands Voices is a school club and music elective at Northern Highlands Regional High School.</p>'+
				'</div>'+
				'</div>';
			var infowindow = new google.maps.InfoWindow({
				content: contentString
			});

	var companyPos = new google.maps.LatLng(41.035082, -74.144111);

	var companyMarker = new google.maps.Marker({
		position: companyPos,
		map: map,
		title:"Northern Highlands",
		zIndex: 3});

	google.maps.event.addListener(companyMarker, 'click', function() {
		infowindow.open(map,companyMarker);
	});
}
